L2_gloss:
Gurmukhi letter ਫੱਫਾ (phaphā)
Guru Granth Sahib, Guru Arjan, translation by Dr. Sant Singh Khalsa, ang 258:
ਫਫਾ ਫਿਰਤ ਫਿਰਤ ਤੂ ਆਇਆphaphā phirat phirat tū āeāphapha: After wandering and wandering for so long, you have come;

Gurmukhi letter ਲੱਲਾ (lallā)
Guru Granth Sahib, Guru Arjan, translation by Dr. Sant Singh Khalsa, ang 252:
ਲਲਾ ਲਪਟਿ ਬਿਖੈ ਰਸ ਰਾਤੇlallā lapṭe bikhae ras rāteLalla: People are entangled in the love of corrupt pleasures;

Gurmukhi letter ੜਾੜਾ (ṛāṛā)
Guru Granth Sahib, Guru Arjan, translation by Dr. Sant Singh Khalsa, ang 260:
ੜਾੜਾ ੜਾੜਿ ਮਿਟੈ ਸੰਗਿ ਸਾਧੂṛāṛā ṛāṛ miṭae saṅg sādhūRarra: Conflict is eliminated in the Saadh Sangat, the Company of the Holy;
